Can I avoid using the same $match criteria twice when using $unwind?<p>Take the following data as an example:</p>

<pre><code>{
  _id: 1,
  item: "abc",
  stock: [
    { size: "S", color: "red", quantity: 25 },
    { size: "S", color: "blue", quantity: 10 },
    { size: "M", color: "blue", quantity: 50 }
  ]
}
{
  _id: 2,
  item: "def",
  stock: [
    { size: "S", color: "blue", quantity: 20 },
    { size: "M", color: "blue", quantity: 5 },
    { size: "M", color: "black", quantity: 10 },
    { size: "L", color: "red", quantity: 2 }
  ]
}
{
  _id: 3,
  item: "ijk",
  stock: [
    { size: "M", color: "blue", quantity: 15 },
    { size: "L", color: "blue", quantity: 100 },
    { size: "L", color: "red", quantity: 25 }
  ]
}

</code></pre>

<p>Say I'm going to filter out the <code>stock</code>s that matches the criteria <code>size = 'L'</code>. I already have a multikey index on the <code>stock.size</code> field.</p>

<p>In the aggregation pipeline, if I use the following two operations:</p>

<pre><code>[{$unwind: {path: "$stock"}},
{$match: {"stock.size": "L"}}]
</code></pre>

<p>I will get the desired results, but when the db gets very large, the <code>$unwind</code> step will have to scan the whole collection, without utilizing the existing index, which is very inefficient.</p>

<p>If I reverse the order of the <code>$unwind</code> and <code>$match</code> operations, the <code>$match</code> will utilize the index to apply an early filtering, but the final result will not be as desired: it will fetch the extra <code>stock</code>s that are not of size L, but have sibling L-sized <code>stock</code>s that belong to the same <code>item</code>.</p>

<p>Would I have to use the same <code>$match</code> operation twice, i.e. both before and after the <code>$unwind</code>, to make it both utilizing the index and return the correct results?</p>

